import React, { useState, useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { LanguageContext } from '../context/LanguageContext';
import { useAuth } from '../context/AuthContext';
import { translations as enTranslations } from '../translations/en';
import { translations as arTranslations } from '../translations/ar';
import './Auth.css';

const Register = () => {
  const { language } = useContext(LanguageContext);
  const { register } = useAuth();
  const navigate = useNavigate();
  const translations = language === 'ar' ? arTranslations : enTranslations;
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    confirmPassword: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
    setError('');
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    // Basic validation
    if (!formData.name || !formData.email || !formData.password || !formData.confirmPassword) {
      setError(translations.register.errorRequired);
      setLoading(false);
      return;
    }

    if (formData.password !== formData.confirmPassword) {
      setError(translations.register.errorPasswordMatch);
      setLoading(false);
      return;
    }

    if (formData.password.length < 6) {
      setError(translations.register.errorPasswordLength);
      setLoading(false);
      return;
    }

    try {
      const result = await register({
        name: formData.name,
        email: formData.email,
        password: formData.password
      });

      if (result.success) {
        navigate('/');
      } else {
        setError(result.message || translations.register.errorRegister);
      }
    } catch (err) {
      setError(err.message || translations.register.errorRegister);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="auth-page">
      <div className="container">
        <div className="auth-container">
          <div className="auth-header">
            <h1 className="auth-title">{translations.register.title}</h1>
            <p className="auth-subtitle">{translations.register.subtitle}</p>
          </div>

          <form className="auth-form" onSubmit={handleSubmit}>
            {error && <div className="error-message">{error}</div>}

            <div className="form-group">
              <label htmlFor="name">{translations.register.nameLabel}</label>
              <input
                type="text"
                id="name"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
                className="form-input"
                placeholder={translations.register.namePlaceholder}
              />
            </div>

            <div className="form-group">
              <label htmlFor="email">{translations.register.emailLabel}</label>
              <input
                type="email"
                id="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
                className="form-input"
                placeholder={translations.register.emailPlaceholder}
              />
            </div>

            <div className="form-group">
              <label htmlFor="password">{translations.register.passwordLabel}</label>
              <input
                type="password"
                id="password"
                name="password"
                value={formData.password}
                onChange={handleChange}
                required
                className="form-input"
                placeholder={translations.register.passwordPlaceholder}
              />
            </div>

            <div className="form-group">
              <label htmlFor="confirmPassword">{translations.register.confirmPasswordLabel}</label>
              <input
                type="password"
                id="confirmPassword"
                name="confirmPassword"
                value={formData.confirmPassword}
                onChange={handleChange}
                required
                className="form-input"
                placeholder={translations.register.confirmPasswordPlaceholder}
              />
            </div>

            <div className="form-options">
              <label className="checkbox-label">
                <input type="checkbox" required />
                <span>{translations.register.agreeTerms}</span>
              </label>
            </div>

            <button type="submit" className="auth-button" disabled={loading}>
              {loading ? translations.register.loading || 'Loading...' : translations.register.submitButton}
            </button>

            <div className="auth-footer">
              <p>
                {translations.register.haveAccount}{' '}
                <Link to="/login" className="auth-link">
                  {translations.register.loginLink}
                </Link>
              </p>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Register;
